bioghist.p:
De taken van de afdeling Indirecte Belastingen betroffen de behandeling van aangelegenheden inzake:  


rechten van successie, van schenking en van overgang en belastingen van rechtsverkeer;


wetgeving op het notarisambt en de Natuurschoonwet 1928 voor zover het ministerie daarbij betrokken is.

